import './App.css';

function RightMenu(){
    const nav = {news:'Новости', home: 'Главная', tri:'Три', chetire:'Четыре', pyat:'puagbapguhauphga'}
    return (
        <div>
            <ul className="alignRight">
                <li>{nav.news}</li>
                <li>{nav.home}</li>
                <li>{nav.tri}</li>
                <li>{nav.chetire}</li>
                <li>{nav.pyat}</li>
            </ul>
        </div>
    );
}

export default RightMenu
